response.about:
Dustin - уже давно одно из самых узнаваемых имен в клубной жизни Зп. Украины. Море драйва, положительной энергетики, свободы движений, полета вместе с ошеломляюще яркой музыкой, двойного сердцебиения DJ и людей - в этом сущность Dustin'а! Сущность, которая открывается как в укромном underground клубе, так и в хорошо обжитом party-bar'е, где все друг друга знают; как на закрытой вечеринке в кругу друзей, так и на большом open-air'е со всей его масштабностью; как на волнах любимой радиостанции в рамках любимиого радио шоу, повествующего о новых тенденциях в мире танцевальной музыки, так и в миксах разданых людям в клубе и распространенных ими дальше.

Любитель качественного саунда, острых ощущений, громких рейвов и блинчиков [=)] - Dustin, со своей самоотдачей за пультом, в состоянии заставить толпу войти в эйфорический полет, и с утра оставить танцпол в восторге. Тем самым доказав всем и себе, что диджеинг - это именно то, чему стоит посвятить всю жизнь. Увидимся в клубе =).

- участник многих вечеринок, open-air'ов и фестивалей;                                      -один из создателей и координаторов GRAЙ DJ School; 
- соавтор радио-шоу "Нічний Десант" на СІД.FM и организатор серии клубных вечеринок с таким же названием;
- частый гость радиошоу "Guest Mix" на Kiss.FM;
- лучший DJ г.Луцка по итогам голосования интерактивного рейтинга TopDJ.ua, сезон (08-09, 09-10, 10-11);
- best dj Волынской области по версии WNLA 2010, 2011, 2012.

E-Mail: sergey.dustin@gmail.com
